import React, { useState } from 'react';
import { View, Text, TextInput, TouchableOpacity, KeyboardAvoidingView, Platform } from 'react-native';
import { styles } from '../styles-part/MobileRegistrationStyles';
import SafeMitraLogo from '../../components/SafeMitraLogo';

const MobileRegistrationScreen = ({ navigation }) => {
  const [phoneNumber, setPhoneNumber] = useState('');

  const handleContinue = () => {
    // Add phone number validation and navigation logic here
    if (phoneNumber.length === 10) {
      // Navigate to OTP verification or next screen
      // navigation.navigate('OTPVerification', { phoneNumber });
    }
  };

  return (
    <KeyboardAvoidingView 
      behavior={Platform.OS === 'ios' ? 'padding' : 'height'}
      style={styles.container}
    >
      <View style={styles.contentContainer}>
        <SafeMitraLogo color="#FF3B30" size={100} />
        
        <Text style={styles.title}>Enter Mobile Number</Text>
        <Text style={styles.subtitle}>We'll send you a verification code</Text>
        
        <View style={styles.inputContainer}>
          <Text style={styles.prefix}>+91</Text>
          <TextInput
            style={styles.input}
            value={phoneNumber}
            onChangeText={setPhoneNumber}
            placeholder="Enter your mobile number"
            keyboardType="number-pad"
            maxLength={10}
          />
        </View>
      </View>

      <TouchableOpacity 
        style={[
          styles.button,
          phoneNumber.length === 10 && styles.buttonActive
        ]}
        onPress={handleContinue}
        disabled={phoneNumber.length !== 10}
        activeOpacity={0.8}
      >
        <Text style={[
          styles.buttonText,
          phoneNumber.length === 10 && styles.buttonTextActive
        ]}>Continue</Text>
      </TouchableOpacity>
    </KeyboardAvoidingView>
  );
};

export default MobileRegistrationScreen;
